import React from 'react';
//Import Component
import Todo from './Todo.js'

const TodoList = ({ todo, todos, setTodos, filteredTodos }) => {
    return(
        <div className="todo-container">
            <ul className="todo-list">
                {todos.map((todo) => {
                    <Todo 
                        setTodos = {setTodos}
                        todos = {todos}
                        key={todo.id} 
                        todo = {todo}
                        text={todo.text} 
                        
                    />
                })}
                
            </ul>
        </div>

    );

}

export default TodoList;
